import React from 'react';
import Particles from 'react-particles-js';
function App() {
  return (
    <>
    <Particles
        style={{ position: "absolute",backgroundColor:"red" }}
        height="100%"
        width="100%"
        params={{
          particles: {
            color: {
              value: "#000000"
            },
            number: {
              value: 400,
              density: {
                enable: true,
                value_area: 800
              }
            },
            line_linked: {
              color: {
                value: "#000000"
              }
            },
            number: {
              value: 50
            },
            size: {
              value: 3
            }
          }
        }}
      />
    <div className="App">
      <h1>Hi</h1>
    </div>
    </>
  );
}

export default App;
